const newRoomId = () => {
	const s4 = () => (((1 + Math.random()) * 0x10000)|0).toString(16).substring(1);
	return s4() + s4() + "-" + s4() + s4() + s4() + s4();
};

export default {
	newRoom: (params) => {
		return {
			room: {
				id: newRoomId(),
				name: params.roomName
			},
			loggedUser: {
				userId: params.userId,
				isAdmin: true,
				username: params.username,
				email: params.email
			},
			questions: []
		};
	}
};
